  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112352 includes chemical,
  discrete sample, physical and profile data collected from MIRAI in the Arctic Ocean,
  Beaufort Sea and Bering Sea from 2000-08-03 to 2000-10-13 and retrieved during cruise
  MR00-K06 and PACIFICA_49NZ20000803. These data include ALKALINITY, AMMONIUM, DISSOLVED
  INORGANIC CARBON, DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE,
  NITRATE, NITRITE, PHOSPHATE, Potential temperature (theta), SALINITY, SILICATE and
  WATER TEMPERATURE. The instruments used to collect these data include CTD, Coulometer
  for DIC measurement and bottle. These data were collected by Akihiko Murata and
  Takatoshi Takizawa of Japan Agency for Marine-Earth Science and Technology (Jamstec)
  as part of the PACIFICA_49NZ20000803 data set.nnPACIFICA (PACIFic ocean Interior
  CArbon) was an international collaborative project for the data synthesis of ocean
  interior carbon and its related parameters in the Pacific Ocean. The North Pacific
  Marine Science Organization (PICES), Section of Carbon and Climate (S-CC) supported
  the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
